import React from "react";

class Footer extends React.Component
{
    render()
    {
        return (
            <div id="footer">
            <div class="row justify-content-center">
                <i class="fa fa-facebook-square socialIcon mt-3 p-2"></i>
                <i class="fa fa-instagram socialIcon mt-3 p-2"></i>
                <i class="fa fa-twitter socialIcon mt-3 p-2"></i>
            </div>

            <div class="col-4 mt-2 footerLinks">
                <a href="Aboutus.html">אודות</a>
            </div>

        </div>
        );
    }

}
export default Footer
